import { useState } from "react"
import { Link, useNavigate } from "react-router-dom";
import { toast } from "react-toastify";
import './login.css'


const Login = () =>{
    const [identifier, identifierUpdate] = useState('');
    const [password, passwordUpdate] = useState('');
    const navigate = useNavigate();

    const ProceedLoginusingAPI = (e) => {
        e.preventDefault();
        if (validate()) {
            let inputobj={"identifier": identifier,
            "password": password};
            fetch("http://localhost:1731/user/login",{
                method:'POST',
                headers:{'content-type':'application/json'},
                body:JSON.stringify(inputobj)
            }).then((res)=>{
                console.log(res);
                if(res.status === 200){
                    res.json().then(data => {
                        sessionStorage.setItem('username',data.username);
                        sessionStorage.setItem('token', data.token);
                    })
                    navigate('/dashboard');
                }
            })
        }
    }
    const validate = () => {
        let result = true;
        if (identifier === '' || identifier === null) {
            result = false;
            toast.warning('Please Enter Username');
        }
        if (password === '' || password === null) {
            result = false;
            toast.warning('Please Enter Password');
        }
        return result;
    }
    return (
        <div class="rounded-[30px] bg-[#FFFFFF] flex flex-row p-[0_0_0_5px] w-[1440px] box-sizing-border">
  <div class="bg-[url('../assets/images/mobileLogin1.jpeg')] bg-[50%_50%] bg-cover bg-no-repeat m-[136px_10px_183px_0] w-[705px] h-[705px]">
