      <span class="break-words font-['Poppins'] font-semibold text-[20px] text-[#003E9C]">
        REGISTER
      </span>
    </div>
    <div class="m-[0_8.8px_10px_0] inline-block break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
      Or
    </div>
    <span class="m-[0_0_0_18.6px] break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
      Login to your account
    </span>
  </div>
  <img class="absolute top-[0px] right-[0.2px] w-[721.8px] h-[817px]" src="../assets/vectors/vector12_x2.svg" />
  <span class="absolute top-[100px] right-[217.5px] break-words font-['Poppins'] font-normal text-[15px] text-[#FFFFFF]">
    Create an account for faster and easier checkout.<br />

  </span>
  <p class="absolute top-[169px] right-[524.4px] break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
    <span class="name-sub-0"></span><span></span>
  </p>
  <p class="absolute top-[301px] right-[519.7px] break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
    <span class="email-sub-0"></span><span></span>
  </p>
  <p class="absolute top-[427px] right-[476.5px] break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
    <span class="user-name-sub-0"></span><span></span>
  </p>
  <p class="absolute right-[488.8px] bottom-[438px] break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
    <span class="password-sub-0"></span><span></span>
  </p>
  <p class="absolute right-[401.8px] bottom-[304px] break-words font-['Poppins'] font-normal text-[20px] text-[#FFFFFF]">
    <span class="confirm-password-sub-0"></span><span></span>
  </p>
  <span class="absolute top-[50px] right-[453.5px] break-words font-['Poppins'] font-semibold text-[32px] text-[#FFFFFF]">
    REGISTER
  </span>
  <div class="rounded-[10px] border-[1px_solid_#FFFFFF] bg-[#FFFFFF] absolute top-[213px] right-[121px] p-[13px_18px_14px_18px] w-[480px] box-sizing-border">
    <span class="break-words font-['Poppins'] font-normal text-[20px] text-[#003E9C]">
      K.S.Marimuthu Prabhu
    </span>
  </div>
  <div class="rounded-[10px] border-[1px_solid_#FFFFFF] bg-[#FFFFFF] absolute top-[345px] right-[121px] p-[13px_18px_14px_18px] w-[480px] box-sizing-border">
    <span class="break-words font-['Poppins'] font-normal text-[20px] text-[#003E9C]">
      muthuaug25@gmail.com
    </span>
  </div>
  <div class="rounded-[10px] border-[1px_solid_#FFFFFF] bg-[#FFFFFF] absolute top-[471px] right-[121px] p-[13px_18px_14px_18px] w-[480px] box-sizing-border">
